import { StyleSheet, Text, View } from 'react-native'
import React from 'react'
import {NavigationContainer} from '@react-navigation/native';
import Tabs from './Tabs';

 export default function Home () {
  return (
  <NavigationContainer>
    <Tabs></Tabs>
  </NavigationContainer>
  )
}
